import * as actionTypes from "../actions/actionTypes";
const initialState = {
    cryptoData: []
}

const cryptoDataReducer = (state = initialState, action) => {
    switch (action.type) {
        case actionTypes.ADD_CRYPTO_DATA:
            return {
                cryptoD
            }
    }
}
